import React, { Component } from 'react';


const formValid = formErrors => {
    let valid = true;

    Object.values(formErrors).forEach ( val => {val.length > 0 && (valid=false);});
    return valid;
};

class Login extends Component {
constructor(props){
    super(props);

    this.state = {
        firstName: null,
        lastName: null,
        email: null,
        password: null,
        formErrors: {
            firstName: "",
            lastName: "",
            email: "",
            password: ""
        }
    };

}

handleSubmit =  e => {
    e.preventDefault();

    if(formValid(this.state.formErrors)){
        console.log(`Submitting
        First Name: ${this.state.firstName}
        Last Name: ${this.state.lastName}
        Email: ${this.state.email}
        Password: ${this.state.password}
        `)
    } else {
        console.error('Form Invalid - display error message');
    }
}

    render() {
return (

<div className="wrapper">
    <div className="form-wrapper">
        <h1>Create Account</h1>
        <form onSubmit={this.handleSubmit} noValidate>
            <div className="firstName">
                <label htmlFor="firstName">First Name</label>
                <input type="text" className="" placeholder="First Name" type="text" name="firstName"
                    onChange={this.handleChange} noValidate />
            </div>
            <div className="lastName">
                <label htmlFor="lastName">Last Name</label>
                <input type="text" className="" placeholder="Last Name" type="text" name="lastName"
                    onChange={this.handleChange} noValidate />
            </div>
            <div className="email">
                <label htmlFor="email">Email</label>
                <input type="email" className="" placeholder="Email" type="text" name="email"
                    onChange={this.handleChange} noValidate />
            </div>
            <div className="password">
                <label htmlFor="password">Password</label>
                <input type="password" className="" placeholder="Password" type="text" name="password"
                    onChange={this.handleChange} noValidate />
            </div>
            <div className="createAccount">
            <button type="submit">Create Account</button>
            <small>Already Have an Account?</small>
            </div>
        </form>
    </div>
</div>
);
}
};

export default Login;
